import './App.css';
import Category1 from './Category1';
import Category2 from './Category2';
import Category3 from './Category3';
// colors 90A8ED FF90E8 FFC900 23A094 bg-[#E5FAFF]
function App() {
  return (
    <div className = 'grid grid-rows-10 w-screen h-screen bg-[#E5FAFF] body-font font-fleuron'>
      <div className='flex row-span-3 w-full h-full  justify-center content-center '>
        <div className='border-b-2 border-black w-11/12 h-full'></div>
      </div>
      <div className='flex row-span-3 w-full h-full justify-center content-center text-6xl font-fleuron'>
        <div className='w-11/12 border-b-2 border-black mt-10'>
          Cognitia 2k23 <br/>
          A tech and cultural fest <br/>
          Like no other
        </div>
      </div>
      <div className='flex flex-nowrap overflow-clip justify-center content-center w-full h-full '>
        <div className='flex row-span-4 space-x-10 bg-[#E5FAFF]  place-items-center w-11/12 h-full flex-nowrap overflow-scroll'>
          <Category1 />
          <Category2 />
          <Category3 />
          <button className=" flex relative translate-x-5 translate-y-5 items-center bg-[#E5FAFF] border-2 border-black rounded-2xl h-20 w-[100px] justify-center hover:bg-catbg3">
                 <svg xmlns="http://www.w3.org/2000/svg" height="3em" viewBox="0 0 448 512">
                 <path d="M438.6 278.6c12.5-12.5 12.5-32.8 0-45.3l-160-160c-12.5-12.5-32.8-12.5-45.3 0s-12.5 32.8 0 45.3L338.8 224 32 224c-17.7 0-32 14.3-32 32s14.3 32 32 32l306.7 0L233.4 393.4c-12.5 12.5-12.5 32.8 0 45.3s32.8 12.5 45.3 0l160-160z"/>
                 </svg>
             </button>
        </div>
      </div>
    </div>
  );
}

export default App;
